func formatMoney(value int64) string {
	var result string
	var isNegative bool

	if value < 0 {
		value = value * -1
		isNegative = true
	}

	// for each 3 dÃ­gits put a dot "."
	for value >= 1000 {
		result = fmt.Sprintf("%s%03d%s", ".", value%1000, result)
		value /= 1000
	}

	if isNegative {
		return fmt.Sprintf("Rp -%d%s", value, result)
	}

	return fmt.Sprintf("Rp %d%s", value, result)
}

